import React, { useState } from "react";
import Link from "next/link";

import { VideoGaleryStyle } from "./VideoGaleryStyle";
import FontButton from "../../styles/fontsStyles/fontButton";

const VideoGalery = props => {


    return (
        <VideoGaleryStyle >
            <FontButton color={props.color} size={props.size}> {props.content}</FontButton>   
        </VideoGaleryStyle>
    );
};

export default VideoGalery;
